public int find(int[] data, int tgt) { 
  int result = -1; 
  int s = 0; 
  int b = data.length - 1; 
  while( result == -1 && s <= b ){ 
    int m = (s + b) / 2; 
    int val = data[m]; 
    if( val == tgt ) 
      result = m; 
    else if( val < tgt ) 
      s = m + 1; 
    else 
      b = m - 1; 
  } 
  if(result == -1) 
    result = s; 
  return result; 
} 
